  render() {
    return (
      <div className="controls">
        {/* add delete button here later */}
        {/* <Button text={"Delete"} /> */}
        <Button
          id={this.props.id}
          liked={this.props.liked}
          onLikeClick={this.props.onLikeClick}
          text={"Liked"}
